pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2; //enable for return struct logData

contract logContract {

    uint256 logCount;
    struct logData {
        address from_account_address;
        //string from_account_name;
        address to_account_address;
        //string to_account_name;
        //string contract_name;
        address contract_address;
        //address contract_parent_address;
        //string playlist_name;
        string contract_exec_result;
        uint16 transfer_coins;
        //string action_name;
        string update_time;
    }

    event evtUpdate(string cate, string action, string updatetime);

    mapping(uint => logData) private logStore;
    logData[] private logDataList;

    //send log into blkchain
    function sendLog(address _from_account_address, address _to_account_address, address _contract_address, string memory  _contract_exec_result, uint16 _transfer_coins, string memory _update_time) public payable {
        logData memory log = logData(_from_account_address, _to_account_address, _contract_address, _contract_exec_result, _transfer_coins, _update_time);
        logStore[logCount] = log; 
        logDataList.push(log);
        logCount +=1 ;

        emit evtUpdate("log", "new log inserted", _update_time);

}
    //get single log by index
    function getLog(uint _index) public view returns (logData memory) {
        logData storage loginstance = logStore[_index];
        return loginstance;
    }

    //get current count of logDatas 
    function getTotalCount() public view returns(uint totalCount) {
        return logDataList.length;
    }

}
